window.onload = function () {
	
	//Get html elements
	var provinsiSel = document.getElementById("provinsiSel");
	var kotaSel = document.getElementById("kotaSel");	
	var kecamatanSel = document.getElementById("kecamatanSel");
	var desaSel = document.getElementById("desaSel");
	//Get html elements
	var provinsiSel2 = document.getElementById("provinsiSel2");
	var kotaSel2 = document.getElementById("kotaSel2");	
	var kecamatanSel2 = document.getElementById("kecamatanSel2");
	var desaSel2 = document.getElementById("desaSel2");
	
	//Load countries
	for (var provinsi in provinsiCabumInfo) {
		provinsiSel.options[provinsiSel.options.length] = new Option(provinsi, provinsi);
	}
	
	//Load countries
	for (var provinsi in provinsiCabumInfo) {
		provinsiSel2.options[provinsiSel2.options.length] = new Option(provinsi, provinsi);
	}
	
	//County Changed
	provinsiSel.onchange = function () {
		 
		 kotaSel.length = 1; // remove all options bar first
		 kecamatanSel.length = 1; // remove all options bar first
		 desaSel.length = 1; // remove all options bar first
		 
		 if (this.selectedIndex < 1)
			 return; // done
		 
		 for (var kota in provinsiCabumInfo[this.value]) {
			 kotaSel.options[kotaSel.options.length] = new Option(kota, kota);
		 }
	}
	
	//County Changed
	provinsiSel2.onchange = function () {
		 
		 kotaSel2.length = 1; // remove all options bar first
		 kecamatanSel2.length = 1; // remove all options bar first
		 desaSel2.length = 1; // remove all options bar first
		 
		 if (this.selectedIndex < 1)
			 return; // done
		 
		 for (var kota in provinsiCabumInfo[this.value]) {
			 kotaSel2.options[kotaSel2.options.length] = new Option(kota, kota);
		 }
	}
	
	//State Changed
	kotaSel.onchange = function () {		 
		 
		 kecamatanSel.length = 1; // remove all options bar first
		 desaSel.length = 1; // remove all options bar first
		 
		 if (this.selectedIndex < 1)
			 return; // done
		 
		 for (var kecamatan in provinsiCabumInfo[provinsiSel.value][this.value]) {
			 kecamatanSel.options[kecamatanSel.options.length] = new Option(kecamatan, kecamatan);
		 }
	}
	
	//State Changed
	kotaSel2.onchange = function () {		 
		 
		 kecamatanSel2.length = 1; // remove all options bar first
		 desaSel2.length = 1; // remove all options bar first
		 
		 if (this.selectedIndex < 1)
			 return; // done
		 
		 for (var kecamatan in provinsiCabumInfo[provinsiSel2.value][this.value]) {
			 kecamatanSel2.options[kecamatanSel2.options.length] = new Option(kecamatan, kecamatan);
		 }
	}
	
	//City Changed
	kecamatanSel.onchange = function () {
		desaSel.length = 1; // remove all options bar first
		
		if (this.selectedIndex < 1)
			return; // done
		
		var desas = provinsiCabumInfo[provinsiSel.value][kotaSel.value][this.value];
		for (var i = 0; i < desas.length; i++) {
			desaSel.options[desaSel.options.length] = new Option(desas[i], desas[i]);
		}
	}	
	
	//City Changed
	kecamatanSel2.onchange = function () {
		desaSel2.length = 1; // remove all options bar first
		
		if (this.selectedIndex < 1)
			return; // done
		
		var desas = provinsiCabumInfo[provinsiSel2.value][kotaSel2.value][this.value];
		for (var i = 0; i < desas.length; i++) {
			desaSel2.options[desaSel2.options.length] = new Option(desas[i], desas[i]);
		}
	}	
}
